const cpuCount = require('os').cpus().length
const es6Transform = require('karma-typescript-es6-transform')

module.exports = function (config, base, karmaTypescriptConfig) {
  const hasFlag = (flag) => process.argv.some((arg) => arg === flag)
  const isDebug = hasFlag('--debug')
  const isWatch = hasFlag('--auto-watch')

  const common = {
    // base path that will be used to resolve all patterns (eg. files, exclude)
    basePath: '.',

    files: [{ pattern: './src/**/*.ts' }],

    // list of files to exclude
    exclude: [],

    plugins: [
      'jasmine-core',
      'karma-jasmine',
      'karma-typescript',
      'karma-spec-reporter',
      'karma-chrome-launcher',
    ],

    frameworks: ['jasmine', 'karma-typescript'],

    preprocessors: {
      '**/*.ts': ['karma-typescript'],
    },

    reporters: ['spec', 'karma-typescript'],

    specReporter: {
      suppressPassed: isWatch || isDebug,
    },

    browsers: [process.env.CI ? 'ChromeHeadless' : 'ChromeHeadless'],

    customLaunchers: {
      ChromeHeadless: {
        base: 'Chrome',
        flags: [
          '--headless',
          '--no-sandbox',
          '--disable-gpu',
          '--disable-translate',
          '--disable-extensions',
          '--remote-debugging-port=9222',
        ],
      },
    },

    client: {
      jasmine: {
        random: false,
      },
    },

    // web server port
    port: 9876,

    // enable / disable colors in the output (reporters and logs)
    colors: true,

    // level of logging
    // possible values: config.LOG_DISABLE || config.LOG_ERROR || config.LOG_WARN || config.LOG_INFO || config.LOG_DEBUG
    logLevel: config.LOG_INFO,

    // enable / disable watching file and executing tests whenever any file changes
    autoWatch: false,

    // Continuous Integration mode
    // if true, Karma captures browsers, runs the tests and exits
    singleRun: true,

    // Concurrency level
    // how many browser should be started simultaneous
    concurrency: cpuCount || Infinity,
  }

  const reportsDir = 'test/coverage'

  config.set(
    Object.assign(common, base, {
      karmaTypescriptConfig: {
        tsconfig: 'tsconfig.json',
        include: ['./src/**/*.ts'],
        bundlerOptions: {
          sourceMap: true,
          transforms: [
            es6Transform({
              presets: [['@babel/preset-env']],
            }),
          ],
        },
        coverageOptions: {
          instrumentation: !isDebug,
          exclude: /\.(test|spec)\.ts$/,
        },
        reports: {
          html: reportsDir,
          lcovonly: {
            directory: reportsDir,
            subdirectory: './',
            filename: 'lcov.info',
          },
          cobertura: {
            directory: reportsDir,
            subdirectory: './',
            filename: 'coverage.xml',
          },
          'text-summary': '',
        },
        ...karmaTypescriptConfig,
      },
    }),
  )
}

import fs from 'fs'
import path from 'path'
import _ from 'lodash'
import colors from 'colors/safe.js'
import terser from '@rollup/plugin-terser'
import replace from '@rollup/plugin-replace'
import resolve from '@rollup/plugin-node-resolve'
import commonjs from '@rollup/plugin-commonjs'
import filesize from 'rollup-plugin-filesize'
import typescript from '@rollup/plugin-typescript'

function formatName(name) {
  const realName = name
    .replace(/^@/, '')
    .replace(/^antv\//, '')
    .replace(/\//, '-')

  // PascalCase
  return _.startCase(_.camelCase(realName)).replace(/ /g, '')
}

function makeOutput() {
  const cwd = process.cwd()
  const pkg = JSON.parse(
    fs.readFileSync(path.join(cwd, 'package.json'), 'utf8'),
  )
  const peerDependencies = pkg.peerDependencies
  const output = { name: formatName(pkg.name) }
  if (peerDependencies) {
    const globals = {}
    Object.keys(peerDependencies).forEach((mod) => {
      globals[mod] = formatName(mod)
    })
    output.globals = globals
  }

  return output
}

export function config(config = {}) {
  let { plugins = [], output, external = [], ...others } = config
  if (output == null) {
    output = makeOutput()
  }

  const arr = Array.isArray(output) ? output : [output]
  const outputs = []
  arr.forEach((item) => {
    outputs.push({
      format: 'umd',
      file: 'dist/index.js',
      sourcemap: true,
      ...item,
    })

    // extra external modules
    if (item.globals) {
      Object.keys(item.globals).forEach((key) => {
        if (!external.includes(key)) {
          external.push(key)
        }
      })
    }
  })

  return {
    input: './src/index.ts',
    output: outputs,
    plugins: [
      typescript({ declaration: false }),
      resolve(),
      commonjs(),
      replace({
        preventAssignment: true,
        'process.env.NODE_ENV': JSON.stringify('production'),
      }),
      terser({ sourceMap: true }),
      filesize({
        reporter: [
          async (options, bundle, result) => {
            return import('boxen').then((mod) => {
              const boxen = mod.default
              const primaryColor = options.theme === 'dark' ? 'green' : 'black'
              const secondaryColor =
                options.theme === 'dark' ? 'yellow' : 'blue'

              const title = colors[primaryColor].bold
              const value = colors[secondaryColor]

              const lines = [
                `${title('Bundle Format:')} ${value(bundle.format)}`,
                `${title('Bundle Name:')} ${value(bundle.name)}`,
              ]
              const globals = bundle.globals
              const mods = Object.keys(globals)
              if (mods.length) {
                lines.push(title('External Globals:'))
                mods.forEach((mod) => {
                  lines.push(value(`  ${mod}: ${globals[mod]}`))
                })
                lines.push('')
              }

              lines.push(
                [
                  `${title('Destination:')} ${value(bundle.file)}`,
                  `${title('Bundle   Size:')} ${value(result.bundleSize)}`,
                  `${title('Minified Size:')} ${value(result.minSize)}`,
                  `${title('Gzipped  Size:')} ${value(result.gzipSize)}`,
                ].join('\n'),
              )

              return boxen(lines.join('\n'), {
                padding: 1,
                dimBorder: true,
                borderStyle: 'classic',
              })
            })
          },
        ],
      }),
      ...plugins,
    ],
    external,
    ...others,
  }
}

const defaultConfig = config()

export default defaultConfig

